UPDATE1
Na slajdzie w 15:40 jest błąd. Oczywiście if do zmiennej nie możemy przypisać (jeśli juz to operator warunkowy: 
warunek ? x : y;


Poprawny zapis (porównaj z tym co na slajdzie) nie zawiera przypisania do zmiennej (a = , b =  , c=) i powinien wyglądać tak

function add(a, b, c) {
 if(a === undefined || typeof a === 'string') a = 0;  
 if(b === undefined || typeof b === 'string') b = 0;  
 if(c === undefined || typeof c === 'string') c = 0;  
 return a + b + c;
}

UPDATE2
Na slajdzie z pętlami (27:46 minuta) jedna zmienna nie jest przez moją uwagę przetłumaczona. W 5 linii jest result+=arguments[i]; a powinno być wynik+=arguments[i];
